import React from "react";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";


const Header = () => {
  return (
    <>
      <AppBar position="fixed" >
        <Toolbar>
          <h1 style={{textalign:"center"}}>Carousel</h1>
        </Toolbar>
      </AppBar>
    </>
  );
};

export default Header;
